import IndexPage from './pages/IndexPage';
import LoginPage from './pages/LoginPage';

function App() {
  return (
    <Routes>
      <Route path={'/'} element={<Layout/>}>
        <Route index element ={<IndexPage/>} />
        <Route path={'/login'} element={<LoginPage/>}></Route>
      </Route>
    </Routes>

  );
}

export default App;
